import { Container, Row, Col } from "react-bootstrap";

function Jurusan() {
  return (
    <Container>
      <Row>
        <Col>
          <h2>Data Jurusan</h2>
        </Col>
      </Row>
    </Container>
  );
}
export default Jurusan;
